import React, { Component } from 'react';

import {
  View,
  Text,
  Platform,
  TextInput,
  StyleSheet,
  Table,
  Row
} from 'react-native';

export default class CustomComponent extends Component{
    static propTypes = {
        FuelUp :JSON,
    }

    render(){
        return(
            <View style={styles.top} >
              <Text style={styles.text}>{this.props.FuelUp.date}</Text>
              <Table>
                <Row>
                  <td>1</td>
                  <td>2</td>
                </Row>
                <Row>
                  <td>3</td>
                  <td>4</td>
                </Row>
                <Row>
                  <td>5</td>
                  <td>6</td>
                </Row>
              </Table>
            </View> 
        )}
}
        
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'top',
  },
  top:{
    flex: 0.3,
    backgroundColor: "#6c757d",
    borderRadius: 20,   
    width:1000,
    marginBottom:10,
  },
  text: {
    color: "#fff",
    fontSize: 40
  }
});
